import React from 'react'

const GoToTop=() =>{
  
  const goToBtn=()=>{
    window.scrollTo({top: 0 , left:0 ,behavior:"smooth"})
  }

  return<div className='top-btn' onClick={goToBtn} align="right">
    <button className='btn-top btn btn-info' ><i className='fa fa-arrow-up'></i></button>
  </div>

}

export default GoToTop
